1.  def LCM_GCD(nums):
    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def lcm(a, b):
        return abs(a * b) // gcd(a, b)

    lcm_result = nums[0]
    gcd_result = nums[0]

    for num in nums[1:]:
        lcm_result = lcm(lcm_result, num)
        gcd_result = gcd(gcd_result, num)

    return lcm_result, gcd_result

